$_MODULE['<{dpdgroup}prestashop>csv_info_9bc3d4557916ea19a55482824d784ad0'] = 'Pentru a importa regulile de transport cu succes urmați liniile ajutatoare:';
$_MODULE['<{dpdgroup}prestashop>csv_info_841bf79243b94dcd66f14d5ed90e29d2'] = '1. Puteți defini reguli de selecție în funcție de greutate, pentru suma totală sau prețul total . Depinde ce setările sunt definite în zonă de transportator:';
$_MODULE['<{dpdgroup}prestashop>csv_info_e79c20ad63c5bb0daa379a5e2e8896d9'] = 'a. In conformitate cu pretul total';
$_MODULE['<{dpdgroup}prestashop>csv_info_8af3e30ca6cf06a05498dba8c9f08df0'] = 'b. In conformitate cu greutatea totala';
$_MODULE['<{dpdgroup}prestashop>csv_info_f4a0f2dae0d12d8b911b2d4a5043666a'] = '2. Prima regula potrivita este sa aplicati pentru un operator de transport asa ca este important să se definească norme mai specifice din partea de sus a fișierului și a normelor cele mai generale în partea de jos a fișierului';
$_MODULE['<{dpdgroup}prestashop>csv_info_19f781881845c01422358b1e5e22a400'] = '3. \"*\" simbol înseamnă toate țările, toate regiunile din țară selectată sau toate codurile ZIP în țara selectată - depinde în care coloana a definit sale';
$_MODULE['<{dpdgroup}prestashop>csv_info_829f282584dc6c2db894519790be5c36'] = '4. Țara este definit de Codul ISO sau un caracter \"*\" (toate țările)';
$_MODULE['<{dpdgroup}prestashop>csv_info_885a4388915efe95007dc7efc75dd206'] = '5. Judetul poate fi definit prin codul ISO sau \"*\" (toate regiunile / statele) caracter. Dacă țara \"*\", apoi Judetul de asemenea trebuie să fie doar \"*\" - imposibil sa de a detecta Judetul dacă țara nu este definita.';
$_MODULE['<{dpdgroup}prestashop>csv_info_335c455811b575cd3559c46e0502b456'] = '6. cod poștal pote fi definit conform formatului definit în PrestaShop pagina setări de țară sau \"*\" simbolul (toate codurile postale / ZIP). Dacă țara \"*\", atunci codul postal, de asemenea, trebuie să fie doar \"*\" - sa imposibil de detectat Cod poștal  dacă țara nu este definita.';
$_MODULE['<{dpdgroup}prestashop>csv_info_10644162b9e2500e12bc00e7f83e768a'] = '7. Greutate / Preț (de la) poate fi număr real => 0.';
$_MODULE['<{dpdgroup}prestashop>csv_info_89b35af15458eb3a9290ea8f290e8435'] = '8. Greutate / Preț (de la) poate fi număr real => 0 și egală sau mai mare atunci Greutate / Preț (de la). Dacă Greutate / Preț (de la) este egală la Greutate / Preț (Pentru) prețul este definit pentru exact valoarea greutate / preț.';
$_MODULE['<{dpdgroup}prestashop>csv_info_a3d8ea3718659680442e15d5769ba858'] = '9. Method ID';
$_MODULE['<{dpdgroup}prestashop>csv_info_506196ece8fd15af31663effd80ea761'] = 'a. 1 - DPD Classic';
$_MODULE['<{dpdgroup}prestashop>csv_info_ed933d3d1b6512425587790966d4a07d'] = 'b. 9 - DPD 10:00';
$_MODULE['<{dpdgroup}prestashop>csv_info_38cf88419879d4938ef3d5876dfe4fbc'] = 'c. 10 - DPD 12:00';
$_MODULE['<{dpdgroup}prestashop>csv_info_75cdbc6b658bf207e53956f95bf11d7a'] = 'd. 27 - DPD Same Day';
