$_MODULE['<{dpdgroup}prestashop>csv_info_cca427dc39c36cbfe532309254ad2b71'] = 'f. 40033 - DPD International';
$_MODULE['<{dpdgroup}prestashop>csv_info_ce2b3b08f853fdce15fe675fb5ef0ad9'] = 'g. 40107 - DPD Bulgaria';
$_MODULE['<{dpdgroup}prestashop>csv_info_c93b2726d06eb392628315792322dcc7'] = 'h. \"*\" - Regula poate fi aplicat la orice operator de transport';
$_MODULE['<{dpdgroup}prestashop>csv_info_cb57aae19cfd6d0e4a13b3cfa55e70e8'] = '10. Prețul Transport - tarif aplicat în cazul în regulă este potrivit pentru un operator de transport';
$_MODULE['<{dpdgroup}prestashop>csv_info_12b46c913b4606f94010a2443adc3995'] = '11. Transport preț procent - tarif procent aplicat în cazul în regula este compensată. Unul dintre - tarifele de transport sau procent tarif de transport  trebuie să fie definit.';
$_MODULE['<{dpdgroup}prestashop>csv_info_b6151c75212e0a2ffa5d0ad4a164ffe4'] = '12. COD Taxă - dacă transportatorul este compatibil cu COD atunci acest cost suplimentar va fi aplicat.';
$_MODULE['<{dpdgroup}prestashop>csv_info_603487d487852805f321a9a760b0a6e4'] = '13. COD Taxă Procentul - dacă transportatorul este compatibil cu COD atunci acest cost suplimentar procent se va aplica. Doar unul din COD Taxă sau COD suprataxă procent poate fi definit.';
$_MODULE['<{dpdgroup}prestashop>csv_info_e9526bbd42a113e3a8ccc20ec75c686e'] = '14. COD Min. Taxă - în cazul în care această valoare este definită, atunci contra cost COD nu trebuie să fie definit și COD Taxă Procentul trebuie să fie definite.';
$_MODULE['<{dpdgroup}prestashop>csv_info_0f6bccc5ce5156c8453224a1182f3ee5'] = '15. În cazul în care regula ar trebui să se aplice purtător COD atunci COD ar trebui să fie definite de exemplu, poate fi, de asemenea, 0, dacă este necesar, dar valoarea trebuie să fie definite și în alte cazuri această regulă nu se aplică pentru transportatorii COD.';
$_MODULE['<{dpdgroup}prestashop>csv_info_2fc9a2866358c30769b37435ad616bbd'] = '16. Moneda- moneda Codul ISO. Ar trebui să existe în instalarea dvs. PrestaShop.';
